import { Button, Form, Input } from "antd";

const Signup = () => {
  return (
    <>
      <Form
        name="basic"
        labelCol={{
          span: 8,
        }}
        wrapperCol={{
          span: 16,
        }}
        style={{
          maxWidth: 600,
          border:"2px solid blue",
          margin:"auto"
        }}
      >
        <Form.Item
          label="User Name or Email"
          name="username"
          rules={[
            {
              required: true,
              message: "please enter your valid user name",
            },
          ]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[
            {
              required: true,
              message: "Please input your password!",
            },
          ]}
        >
          <Input.Password />
        </Form.Item>

      </Form>
    </>
  );
};

export default Signup;
